                          - type: em
                        text: Ministry of Communications and Informatization
                      - type: text
                        text: >-
                          , Minsk, announces that on 19 March 2011, a change
                          will be effected in the dialling plan for the area
                          code for the city of Mozyr in the Mozyr district of
                          the Gomel region.
                  - type: paragraph
                    content:
                      - type: text
                        text: "The first digits of the area code will change from «51» to «6».\_ Subscriber numbers will change from five to six digits through addition of the digit ‘3’ before the existing subscriber number.\_ The subscriber number switch will be at the system level.\_ Parallel running is not foreseen."
                  - type: paragraph
                    content:
                      - type: text
                        text: "Old dialling plan:\_\_\_\_\_\_\_\_\_\_\_ +375 23 51 XXXXX"
                  - type: paragraph
                    content:
                      - type: text
                        text: "New dialling plan:\_\_\_\_\_\_\_\_\_ +375 23 6 3XXXXX"
