        communications:
          - date: 2010-12-22T13:17:47.682Z
            contents:
              en:
                type: doc
                content:
                  - type: paragraph
                    content:
                      - type: text
                        text: The
                      - type: text
                        marks:
                          - type: em
                        text: ' Georgian National Communications Commission (GNCC)'
                      - type: text
                        text: >-
                          , Tbilisi, announces that the Government of Georgia
                          adopted on 18 November 2010 a resolution on approval
                          of a new Georgian Electronic Communications’ National
                          Numbering System.
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          National Numbering System of Georgian Electronic
                          Communications Network has been developed according to
                          the ITU and CEPT relevant regulations.
                  - type: paragraph
                    content:
                      - type: text
                        text: "In the new Numbering National System of Georgian Electronic Communication Network, the joint structure of international number consists of Georgian – country’s international access code (CC + 995) and national number (N(S)N).\_ Its full format consists of twelve (12) digits."
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          Numbering plan of the Georgian electronic
                          communications networks shall consist of the following
                          numbering zones:
                  - type: paragraph
                    content:
                      - type: text
                        text: "1)\_\_\_\_\_\_\_\_\_ Geographic numbering zones comprising subscriber number resources of the operators providing services in various geographic zones of Georgia through fixed electronic communications networks;"
                  - type: paragraph
                    content:
                      - type: text
                        text: "2)\_\_\_\_\_\_\_\_\_ Non-geographic numbering zones comprising:"
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ a)\_\_\_\_\_\_\_\_\_\_\_\_\_ subscriber numbering resources of the operators providing services through mobile electronic communications networks;"
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ b)\_\_\_\_\_\_\_\_\_\_\_\_\_ subscriber numbering resources of the undertakings providing fixed communication services through wireless access, including electrical communications networks of cell type;"
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ c)\_\_\_\_\_\_\_\_\_\_\_\_\_ subscriber numbering resources of the undertakings providing services (including free and shared-cost) through intelligent networks;"
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ d)\_\_\_\_\_\_\_\_\_\_\_\_\_ subscriber numbering resources of the undertakings providing free, value-added and other types of services through personal numbers.\_"
                  - type: paragraph
                    content:
                      - type: text
                        text: "3)\_\_\_\_\_\_\_\_\_ Zone of 1XX(XXX) short numbers (codes) shall comprise:"
                  - type: paragraph
                    content:
                      - type: text
                        text: "\_\_\_\_\_\_\_\_\_\_\_\_\_ Codes for the selection of the service providing operators: numbers and codes of the inquiry and emergency services of the electronic communications operators: emergency services: municipal and other emergency and rescue services; information and inquiry services; medical and social assistance services"
                  - type: paragraph
                    content:
                      - type: text
                        text: "4)\_\_\_\_\_\_\_\_\_ Mobile Network Codes (MNC), international Signalling Point Codes (ISPC) and National Signalling Point Codes (NSPC)."
                  - type: paragraph
                    content:
                      - type: text
                        text: >-
                          The transferring process on national numbering system
                          will be implemented during 2011 according to the main
                          plan, publicly and by stages.
                  - type: paragraph
                    content:
                      - type: text
                        text: "During the first stage (April 2011) will be implemented changes of geographic codes in a number of cities and\_ municipal administrative centres (during the transition period, dates of parallel dialling of the old and new codes will be provided). During the second stage (2 June 2011) will be implemented the changes of Network Destination Code (NDC) that will become three digits.\_ At the same time the existing Destination Networks (DN) codes and Numbers of Subscribers (NS) will remain unchanged.\_ Also will be changed subscriber numbers of fixed telephone networks that will become seven digits in Tbilisi and six digits in other cities and municipal administration centres.\_ One digit will be added to the current subscribers’ numbers as a first digit - «2».\_ During the third stage will be introduced short format 1XX (XXX) numbers (codes), where the end digit «8» will be replaced by digit «0» and the international prefix will be «00» can be dialled separately for each call. Operator’s choosing format (10XX) can be dialled on each call separately."
                  - type: paragraph
                    content:
                      - type: text
                        marks:
                          - type: em
                        text: "First Stage\_"
